    },
    {
        "brand": "Chevrolet",
        "model": "Suburban",
        "years": 2019,
        "color": "Black",
        "price": 50000,
        "car_body": "SUV"
    }
]

function Car(brand,model,years,color,price,car_body){
    return  <li class="nav-item">
    <button className="nav-link">{brand}</button>
</li>
}



export default function Carlist(){

const displayCars=()=>{
    return cars.map(
        car=>{
            const {brand,model,years,color,price,car_body}=car;
            <Car brand={brand} model={model} years={years} color={color} price={price} car_body={car_body}/>
        }
    )
}
    return(
    <>
   
    <ul class="nav nav-tabs" id="navId">
       {displayCars}
    </ul>
    
    </>
    )
}
